res and rankings use data from the Gallup World Poll. The columns following the happiness score estimate the extent to which each of six factors  economic production, social support, life expectancy, freedom, absence of corruption, and generosity  contribute to making life evaluations higher in each country than they are in Dystopia, a hypothetical country that has values equal to the worlds lowest national averages for each of the six factors. They have no impact on the total score reported for each country, but they do explain why some countries rank higher than others."]},{"cell_type":"markdown","id":"fbecb621","metadata":{"papermill":{"duration":0.044785,"end_time":"2022-03-02T14:08:49.200536","exception":false,"start_time":"2022-03-02T14:08:49.155751","status":"completed"},"tags":[]},"source":["# Importing Libraries, Reading and Setting Up the Data"]},{"cell_type":"code","execution_count":1,"id":"b34fffec","metadata":{"execution":{"iopub.execute_input":"2022-03-02T14:08:49.29555Z","iopub.status.busy":"2022-03-02T14:08:49.292891Z","iopub.status.idle":"2022-03-02T14:08:49.473503Z","shell.execute_reply":"2022-03-02T14:08:49.472016Z"},"papermill":{"duration":0.229251,"end_time":"2022-03-02T14:08:49.473686","exception":false,"start_time":"2022-03-02T14:08:49.244435","status":"completed"},"tags":[]},"outputs":[],"source":["#Will load this first before dplyr (which is contained in the tdyverse) to avoid problems\n","\n","#To be able to use the revalue() function\n","library(plyr)"]},{"cell_type":"code","execution_count":2,"id":"a6a886d5","metadata":{"execution":{"iopub.execute_input":"2022-03-02T14:08:49.603741Z","iopub.status.busy":"2022-03-02T14:08:49.56715Z","iopub.status.idle":"2022-03-02T14:09:12.769543Z","shell.execute_reply":"2022-03-02T14:09:12.767205Z"},"papermill":{"duration":23.251344,"end_time":"2022-03-02T14:09:12.769842","exception":false,"start_time":"2022-03-02T14:08:49.518498","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":